import {Component} from "react"
import {PageContainer,Container,Input} from "./styledComponent"
 
class App extends Component {

    render(){
        return(
            <PageContainer>
                <Container >
                    <Input type="text"  />
                </Container>
                <div>
                    <p>Font Style</p>
                </div>
            </PageContainer>
        )
    }
}

 

export default App
